import React from 'react'
import { useSelector } from 'react-redux'

const App = () => {
  const DateConter = useSelector((state) => state.cont)
  console.log(DateConter)
  return (
    <div>
      <h1>conter : {DateConter}</h1>
      <h1>conter : {DateConter}</h1>
    </div>
  )
}

export default App
